description:
निर्वाचन आयोगले आशन्न प्रतिनिधिसभा सदस्य निर्वाचनका लाग खटिएका मुख्य निर्वाचन अधिकृत र निर्वाचन अधिकृतका लागि प्रशिक्षक प्रशिक्षणका लागि यही पुस २८ र २९ गते विभिन्न स्थानमा अभिमुखीकरण तालिम सञ्चालन गर्दैछ ।
&amp;nbsp; &amp;nbsp; &amp;nbsp;
सात प्रदेश

अमेरिकी सेनाले सिरियामा इस्लामिक स्टेट (आईएस) समूहको निशानामा ठूलो मात्रामा आक्रमण शुरू गरेको छ ।&amp;nbsp;

अमेरिकी केन्द्रीय कमाण्ड (सेन्टकम)का अनुसार यी हमलाहरू डिसेम्बर १९, २०२५ मा घोषणा गरिएको अपरेशन हकआई स्ट्राइकको हिस्सा हुन् ।

डिसेम्बर १३, २
